import React, { Component } from 'react'
import NasaNav from './Nav'
import {
  Button,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter,
  Form,
  FormGroup,
  Input,
  Label,
} from "reactstrap";

class Forgot extends Component {
  constructor(props) {
    super(props);
    this.state = {
      e: this.props.activeItem,
    };
  }
  render() {
    return (
      <div>
        <NasaNav />
        <br />
        <br />
        <br />
        <br />
      </div>
    );
  }
}

export default Forgot
